import forumIcon from './forum_icon.png';
import supportIcon from './support_icon.png';
import catalogtIcon from './catalog_icon.png';
import "./css/aside.css"
import { Context } from "./Context";
import { useContext } from "react";

const {setName} = useContext(Context);
const onClickHandler = (titleName) =>{
    setName(titleName);
}

function Aside(){
    return(
        <aside>
            <div className='aside_container'>
                <nav>
                    <li key={1}>
                        <img src={forumIcon} />
                        <a href='/' onClick={onClickHandler("Главная страница")}>Главная страница</a>
                    </li>
                    <li key={2}>
                        <img src={forumIcon} />
                        <p>Личный кабинет</p>
                    </li>
                    <li key={3}>
                        <img src={catalogtIcon} />
                        <a href='/Catalog/' onClick={onClickHandler("Каталог")}>Каталог</a>
                    </li>
                    <li key={4}>
                        <img src={forumIcon} />
                        <a href='/Forum' onClick={onClickHandler("Форум")}>Форум</a>
                    </li>
                    <li key={5}>
                        <img src={supportIcon} />
                        <p>Поддержка</p>
                    </li>
                    
                </nav>
            </div>
        </aside>
        );
}

export default Aside;
